import {
    withGoogleMap,
    GoogleMap,
    Marker,
  } from "react-google-maps";



function Map() {

    const MapWithAMarker = withGoogleMap(props =>
        <GoogleMap
          defaultZoom={8}
          defaultCenter={{ lat: 1000, lng: 150.644 }}
        >
          <Marker
            position={{ lat: 1000, lng: 150.644 }}
          />
        </GoogleMap>
      );



    return(
            <div className="map-wrapper-div">
                <button>Map</button>
                <MapWithAMarker
        containerElement={<div style={{ height: `400px` }} />}
        mapElement={<div style={{ height: `100%` }} />}
      />
            </div>
    )
}

export default Map
